import React from "react";
import styled from "styled-components";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Banner1 from "../images/Banner1.png";
import Banner2 from "../images/Banner2.png";
const rankList = {
  Youtube: [
    {
      id: 1,
      rank: "1",
      image:
        "https://spnimage.edaily.co.kr/images/Photo/files/NP/S/2023/01/PS23012500038.jpg",
    },
    {
      id: 2,
      rank: "2",
      image:
        "https://talkimg.imbc.com/TVianUpload/tvian/TViews/image/2023/03/03/693cef21-b67a-4ce4-81c2-96d5ab8bb43b.jpg",
    },
    {
      id: 3,
      rank: "3",
      image:
        "https://spnimage.edaily.co.kr/images/Photo/files/NP/S/2023/01/PS23012500038.jpg",
    },
    {
      id: 4,
      rank: "4",
      image:
        "https://talkimg.imbc.com/TVianUpload/tvian/TViews/image/2023/03/03/693cef21-b67a-4ce4-81c2-96d5ab8bb43b.jpg",
    },
    {
      id: 5,
      rank: "5",
      image:
        "https://talkimg.imbc.com/TVianUpload/tvian/TViews/image/2023/03/03/693cef21-b67a-4ce4-81c2-96d5ab8bb43b.jpg",
    },
    // {
    //   id: 6,
    //   rank: 6,
    //   image: "https://spnimage.edaily.co.kr/images/Photo/files/NP/S/2023/01/PS23012500038.jpg",
    // },
  ],
};

export default function YoutubeSlider() {
  const settings = {
    arrows: true,
    dots: false,
    infinite: true,
    slidesToShow: 4,
    slidesToScroll: 5,
    variableWidth: false,
  };
  return (
    <div>
      <Container>
        <Slider {...settings}>
          <>
            <BannerImg src={Banner1} alt="banner1" />
          </>
          <>
            <BannerImg src={Banner2} alt="banner2" />
          </>
          <>
            <BannerImg src={Banner1} alt="banner1" />
          </>
          <>
            <BannerImg src={Banner2} alt="banner2" />
          </>
          <>
            <BannerImg src={Banner1} alt="banner1" />
          </>
          <>
            <BannerImg src={Banner2} alt="banner2" />
          </>
          <>
            <BannerImg src={Banner1} alt="banner1" />
          </>
          <>
            <BannerImg src={Banner2} alt="banner2" />
          </>
          <>
            <BannerImg src={Banner1} alt="banner1" />
          </>
          <>
            <BannerImg src={Banner2} alt="banner2" />
          </>
          <>
            <BannerImg src={Banner1} alt="banner1" />
          </>
          <>
            <BannerImg src={Banner2} alt="banner2" />
          </>
          <>
            <BannerImg src={Banner1} alt="banner1" />
          </>
          <>
            <BannerImg src={Banner2} alt="banner2" />
          </>
        </Slider>
      </Container>
    </div>
  );
}

const Container = styled.div`
  background-color: white;
  width: 1000px;
  margin: 0px auto;
  margin-bottom: 200px;
  /* overflow-x:scroll;
    scroll-snap-type: x mandatory; */

  /* overflow:hidden; */

  .slick-dots {
    .slick-active {
      button::before {
        color: #c1c1c1;
      }
    }
    button::before {
      color: #e9e9e9;
    }
  }
`;
const BannerImg = styled.img`
  height: 180px;
  width: 270px;
  padding: 0px auto;
  margin: 0px auto;
  cursor: pointer;
`;
